const teams = (teams = [], action) => {
  switch (action.type) {
    case "FETCH_ALL_TEAMS":
      console.log(action.payload, "ddddd");
     var data = action.payload.filter((team) => team.alliance == null);

      return data;

    case "UPDATE_TEAMS":
      return action.payload;
    default:
      return teams;
  }
};
export default teams;
